// use开头的函数 hook函数
// useEffect == componentDidMount + componentDidUpdate + componentWillUnmount
import { useState, useEffect } from "react";
function Foo() {
  const [count, setCount] = useState(123);
  return <div onClick={() => setCount(count++)}>{count}</div>;
}
export default Foo;
